// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MedicalFileAccess {
    struct LogEntry {
        string uniqueId;    // User unique ID
        string fileName;    // File name
        string action;      // Upload or Access
        string hospital;    // Hospital name
        uint256 timestamp;  // Timestamp of action
    }

    mapping(string => LogEntry[]) private accessLogs;

    // Function to add log entry
    function addLogEntry(
        string memory _uniqueId,
        string memory _fileName,
        string memory _action,
        string memory _hospital
    ) public {
        LogEntry memory newEntry = LogEntry({
            uniqueId: _uniqueId,
            fileName: _fileName,
            action: _action,
            hospital: _hospital,
            timestamp: block.timestamp
        });

        accessLogs[_uniqueId].push(newEntry);
    }

    // Function to get access logs
    function getAccessLogs(string memory _uniqueId) public view returns (LogEntry[] memory) {
        return accessLogs[_uniqueId];
    }
}
